import React from 'react';
import { 
  Card,
  CardContent,
  Typography,
  Grid,
  Container,
  Divider,
  Box,
  Chip
} from '@mui/material';

const MatchList = ({ matches }) => {
  if (!matches || matches.length === 0) {
    return (
      <Container>
        <Typography variant="body1">No tennis matches currently available</Typography>
      </Container>
    );
  }

  return (
    <Container>
      <Grid container spacing={2}>
        {matches.map((match, index) => {
          const rapidData = match.rapid_data?.raw_event_data;
          const betsData = match.betsapi_data;
          const odds = match.odds || {};

          return (
            <Grid item xs={12} key={index}>
              <Card>
                <CardContent>
                  {/* Header with match info and status */}
                  <Box display="flex" justifyContent="space-between" alignItems="center" mb={1}>
                    <Typography variant="h6" component="div">
                      {rapidData ? 
                        `${rapidData.team1} vs ${rapidData.team2}` :
                        betsData?.inplay_event ? 
                          `${betsData.inplay_event.home?.name || ''} vs ${betsData.inplay_event.away?.name || ''}` :
                          'Unknown Match'
                      }
                    </Typography>
                    {(betsData?.inplay_event?.status || rapidData?.state) && (
                      <Chip 
                        color={betsData?.inplay_event?.status === "in-play" || rapidData?.state === "in_play" ? "success" : "default"}
                        size="small"
                        label={betsData?.inplay_event?.status || rapidData?.state || "Unknown"} 
                      />
                    )}
                  </Box>

                  {/* Tournament Information */}
                  {(rapidData?.league || betsData?.league) && (
                    <Typography variant="subtitle2" color="textSecondary" gutterBottom>
                      Tournament: {rapidData?.league || betsData?.league?.name || "Unknown Tournament"}
                    </Typography>
                  )}

                  {/* Match Time/Date */}
                  {(rapidData?.startTime || betsData?.time) && (
                    <Typography variant="body2" color="textSecondary" gutterBottom>
                      Time: {rapidData?.startTime || new Date(betsData?.time * 1000).toLocaleString() || "Unknown"}
                    </Typography>
                  )}

                  {/* Score Information */}
                  {(rapidData?.score || (betsData?.inplay_event && betsData?.inplay_event.scores)) && (
                    <Box my={1}>
                      <Typography variant="subtitle2">Current Score:</Typography>
                      {rapidData?.score && (
                        <Typography variant="body2">
                          {rapidData.team1}: {rapidData.score.team1 || '0'} - {rapidData.team2}: {rapidData.score.team2 || '0'}
                        </Typography>
                      )}
                      {betsData?.inplay_event?.scores && (
                        <Typography variant="body2">
                          {betsData.inplay_event.home?.name}: {betsData.inplay_event.scores.home || '0'} - 
                          {betsData.inplay_event.away?.name}: {betsData.inplay_event.scores.away || '0'}
                        </Typography>
                      )}
                    </Box>
                  )}

                  {/* Odds Information */}
                  {odds && Object.keys(odds).length > 0 && (
                    <Box my={1}>
                      <Typography variant="subtitle2">Odds:</Typography>
                      <Grid container spacing={1}>
                        {odds.home_win && (
                          <Grid item>
                            <Chip size="small" label={`Home: ${odds.home_win}`} />
                          </Grid>
                        )}
                        {odds.away_win && (
                          <Grid item>
                            <Chip size="small" label={`Away: ${odds.away_win}`} />
                          </Grid>
                        )}
                      </Grid>
                    </Box>
                  )}

                  <Divider sx={{ my: 1 }} />

                  {/* IDs and technical info */}
                  <Grid container spacing={1}>
                    {/* Display Event ID if available */}
                    {rapidData?.eventId && (
                      <Grid item xs={12} sm={6}>
                        <Typography variant="body2" color="textSecondary">
                          Event ID: {rapidData.eventId}
                        </Typography>
                      </Grid>
                    )}

                    {/* Display Bet365 ID if available */}
                    {(betsData?.bet365_id || rapidData?.marketFI) && (
                      <Grid item xs={12} sm={6}>
                        <Typography variant="body2" color="textSecondary">
                          Bet365 ID: {betsData?.bet365_id || rapidData?.marketFI}
                        </Typography>
                      </Grid>
                    )}
                  </Grid>

                  {/* Match Status and Data Source */}
                  <Box mt={1}>
                    <Typography variant="body2" color="textSecondary">
                      Data Source: {
                        match.rapid_data && match.betsapi_data ? 'Both APIs' :
                        match.rapid_data ? 'RapidAPI Only' :
                        match.betsapi_data ? 'BetsAPI Only' : 'Unknown'
                      }
                    </Typography>
                  </Box>
                </CardContent>
              </Card>
            </Grid>
          );
        })}
      </Grid>
    </Container>
  );
};

export default MatchList;
